ons to malfunctions, performance issues or any errors.<br />You can faciliate the process of support by providing below information to our support staff.<br /><br />You need to reset the Theme Options (Backup Settings > Restore Default) in order to see changes.<br /><br /><strong>If Highend Options are not saving changes - you need to increase your WP_MEMORY_LIMIT. Please follow <a href="http://hb-themes.com/forum/all/topic/theme-options-not-saving-changes-resolved-fix/" target="_blank">these steps.</a></strong></p><div class="vp-section"><div class="vp-controls"><div class="vp-field"><div class="label"><strong>Theme Name:</strong></div><div class="field">Highend</div></div><div class="vp-field"><div class="label"><strong>Theme Version:</strong></div><div class="field">1.5</div></div><div class="vp-field"><div class="label"><strong>Theme Author:</strong></div><div class="field">HB-Themes</div></div><div class="vp-field"><div class="label"><strong>Site URL:</strong></div><div class="field">http://www.whenshitgoesmadmax.com/test</div></div><div class="vp-field"><div class="label"><strong>Theme Demo:</strong></div><div class="field">http://preview.hb-themes.com/?theme=Highend</div></div><div class="vp-field"><div class="label"><strong>WordPress Version:</strong></div><div class="field">3.9.1</div></div><div class="vp-field"><div class="label"><strong>WordPress Language:</strong></div><div class="field">en-US</div></div><div class="vp-field"><div class="label"><strong>Admin Email:</strong></div><div class="field">info@genco.tv</div></div><div class="vp-field"><div class="label"><strong>Server Information:</strong></div><div class="field">Apache</div></div><div class="vp-field"><div class="label"><strong>PHP Version:</strong></div><div class="field">5.4.30</div></div><div class="vp-field"><div class="label"><strong>WP Memory Limit:</strong></div><div class="field">40 MB <span style=\'color:red\'><br />Recommended memory limit should be at least 64MB. Please, take a look at: <a href=\'http://codex.wordpress.org/Editing_wp-config.php#Increasing_memory_allocated_to_PHP\' target=\'_blank\'>Increasing memory allocated to PHP</a> for more information.</span></div></div><div class="vp-field"><div class="label"><strong>WP Max Upload Size:</strong></div><div class="field">10 MB</div></div><div class="vp-field"><div class="label"><strong>Max Execution Time:</strong></div><div class="field">30 <span style=\'color:red\'><br />Recommended max_execution_time should be at least 120. Please, take a look at: <a href=\'http://hb-themes.com/forum/all/topic/how-to-increase-max_execution_time-variable/\' target=\'_blank\'>Increasing max_execution_time instructions</a> for more information.</span></div></div><div class="vp-field"><div class="label"><strong>WP Debug Mode:</strong></div><div class="field">Disabled</div></div></div></div><div class="hb-buttons"><a href="http://forum.hb-themes.com" class="vp-button button button-primary">Support Forum</a><a href="http://documentation.hb-themes.com/highend" class="vp-button button button-primary">Documentation</a><a href="http://www.youtube.com/user/hbthemes" class="vp-button button button-primary">Video Tutorials</a></div>";s:22:"hb_demo_importer_field";s:1719:"<p>Demo Import will replicate our demo on your website.<br />Please, use it carefully, it will replace some of your data. Also, make sure you don\'t have any issues (marked as red) in the <a href="http://www.whenshitgoesmadmax.com/test/wp-admin/themes.php?page=highend_options#hb_theme_diagnostic" target="_blank">System Diagnostics</a> section, before importing the demo.</p><p>The following data will be imported:</p><ol><li>Blog Posts from Highend Demo.</li><li>All Pages from Highend Demo.</li><li>All Custom Post Types items from Highend Demo.</li><li>Comments from Highend Demo.</li><li>Sliders from Highend Demo. (You need to install and activate sliders first).</li><li>Media library from Highend Demo.</li><li>Theme Options from Highend Demo.</li><li>Widgets and Sidebars from Highend Demo.</li><li>WordPress Menus from Highend Demo.</li></ol><p>FULL Demo Import process can take up to 25 minutes or even more to complete.</p><p><strong>DO NOT interrupt the process.</strong></p><p>The imported stuff cannot be deleted at once, so we suggest to import the demo on your test website, not live website.</p><div class="hb-buttons"><a href="#" class="vp-button button button-primary hb-import-button full-demo-import">Import FULL Demo Content</a><a href="#" class="vp-button button button-primary hb-import-button light-demo-import">Import LIGHT Demo Content</a></div><p>Due to large demo export files, on some hosts the full demo import will fail and generate Error 500 - Internal Server Error.<br />In that case, you can try increasing max_execution_time to 120 and WP_MEMORY_LIMIT to 128M.<br /><br />We strongly suggest to import the LIGHT demo content instead. (The demo content without images and sliders)</p>";s:0:"";s:0:"";}', 'yes'),
