(456, 1, '2014-08-12 10:41:54', '2014-08-12 14:41:54', '/*\nWelcome to Custom CSS!\n\nCSS (Cascading Style Sheets) is a kind of code that tells the browser how\nto render a web page. You may delete these comments and get started with\nyour customizations.\n\nBy default, your stylesheet will be loaded after the theme stylesheets,\nwhich means that your rules can take precedence and override the theme CSS\nrules. Just write here what you want to change, you don\'t need to copy all\nyour theme\'s stylesheet content.\n*/\n/*#main-nav { \n    background-image: url(images/ManhattanKansas_r1.jpg); \n    background-repeat: no-repeat;\n    background-position: center center;\n}*/\n/* Set logo to extend below the main navigation bar */\n#logo img {\n	max-height: none !important;\n	height: 130px !important;\n}\n\n/* Fix logo on mobile pages */\n#show-nav-menu {\n	float: left !important;\n	color: white !important;\n}\n\n@media handheld,only screen and (max-width:900px) {\n	#logo img {\n		max-height: 100% !important;\n	}\n}\n\n/*@media screen and (max-width: 320px) {\n	#hb-header {\n		display: none !important;\n	}\n}*/\n/* Custom style for credits on individual episode pages */\n.credits {\n	font-size: smaller !important;\n	font-weight: 900 !important;\n}\n\n/* Extra large type style */\n.x-large {\n	font-size: x-large;\n	font-weight: 900 !important;\n	border-width: 4px !important;\n	border-color: black !important;\n}\n\n/* Resize and bold the gallery item name type */\n.hb-gallery-item-name {\n	font-size: 9pt !important;\n	font-weight: 900 !important;\n	border: none !important;\n	padding: 0;\n}\n\n.hb-gal-standard-count {\n	visibility: hidden !important;\n}\n\n.hb-gal-standard-description {\n	border: none !important;\n	padding-top: 20px !important;\n}\n\n.noborder {\n	border: none;\n	padding: 0;\n}\n\n/* Product amount red text */\n.amount {\n	color: red !important;\n}\n\n.special {\n	color: white !important;\n}\n\n/* Attempt to make a blank page - No header, no footer */\n.page-id-99 #hb-header {\n	display: none;\n}\n\n.page-id-99 #copyright-wrapper {\n	display: none;\n}\n\n.page-id-99 #contact-button {\n	display: none;\n}\n\ndiv#whiteText h1 {\n	color: white !important;\n}\n\ndiv#whiteText p {\n	color: white !important;\n}\n\n.episodeHead {\n	font-size: x-large;\n	font-weight: 900 !important;\n	border-bottom: 1px solid red;\n	padding-bottom: 5px;\n}\n\n.episodeHeadWhiteText {\n	font-size: xx-large;\n	color: white;\n	font-weight: 900 !important;\n	text-transform: uppercase;\n	border-bottom: 1px solid red;\n	padding-bottom: 5px;\n}\n\n/* Fix hover issue on overlays and ajax buttons */\na.load-more-posts:hover {\n	color: #FFFFFF !important;\n}\n\na.hb-buy-button {\n	color: #FFFFFF !important;\n}\n\na.hb-buy-button:hover {\n	color: #DD3333 !important;\n}\n\na.hb-more-details {\n	color: #FFFFFF !important;\n}\n\na.hb-more-details:hover {\n	color: #DD3333 !important;\n}\n\n/* Change widget title to U&lc, bold, add underline and negative space below */\nh4.widget-title {\n	font-size: 20pt !important;\n	text-transform: capitalize !important;\n	font-weight: bold !important;\n	margin-bottom: 5px !important;\n	border-bottom-style: solid;\n	border-width: 2px;\n	padding-bottom: 5px;\n}\n\n/* Change product widget title to U&lc and bold */\n.widget-item.woocommerce .product_list_widget a {\n	font-size: 11pt;\n	padding-top: 10px;\n	font-weight: 700 !important;\n	text-transform: capitalize !important;\n}\n\n/* Add space above news widget elements */\n.cat-post-item {\n	padding-top: 10px !important;\n	padding-bottom: 10px !important;\n}\n\n/* pf and p indent rule and remove space above \np+p {\n	text-indent: 2em;\n} */\n/* Remove space after p \np {\n	margin: 0;\n	padding: 0;\n} */', 'safecss', 'Highend Child', 'publish', 'open', 'open', '', 'safecss', '', '', '2014-08-13 14:16:07', '2014-08-13 18:16:07', '#logo img{max-height:none !important;height:130px !important}#show-nav-menu{float:left !important;color:#fff !important}@media handheld,only screen and (max-width:900px){#logo img{max-height:100% !important}}.credits{font-size:smaller !important;font-weight:900 !important}.x-large{font-size:x-large;font-weight:900 !important;border-width:4px!important;border-color:#000!important}.hb-gallery-item-name{font-size:9pt !important;font-weight:900 !important;border:none !important;padding:0}.hb-gal-standard-count{visibility:hidden !important}.hb-gal-standard-description{border:none !important;padding-top:20px !important}.noborder{border:none;padding:0}.amount{color:red !important}.special{color:#fff !important}.page-id-99 #hb-header{display:none}.page-id-99 #copyright-wrapper{display:none}.page-id-99 #contact-button{display:none}div#whiteText h1{color:#fff !important}div#whiteText p{color:#fff !important}.episodeHead{font-size:x-large;font-weight:900 !important;border-bottom:1px solid red;padding-bottom:5px}.episodeHeadWhiteText{font-size:xx-large;color:#fff;font-weight:900 !important;text-transform:uppercase;border-bottom:1px solid red;padding-bottom:5px}a.load-more-posts:hover{color:#FFF !important}a.hb-buy-button{color:#FFF !important}a.hb-buy-button:hover{color:#D33 !important}a.hb-more-details{color:#FFF !important}a.hb-more-details:hover{color:#D33 !important}h4.widget-title{font-size:20pt !important;text-transform:capitalize !important;font-weight:700 !important;margin-bottom:5px !important;border-bottom-style:solid;border-width:2px;padding-bottom:5px}.widget-item.woocommerce .product_list_widget a{font-size:11pt;padding-top:10px;font-weight:700 !important;text-transform:capitalize !important}.cat-post-item{padding-top:10px !important;padding-bottom:10px !important}', 0, 'http://localhost/genco/?safecss=safecss', 0, 'safecss', '', 0),
