te !important;\n}\n\n/* Attempt to make a blank page - No header, no footer */\n.page-id-99 #hb-header {\n	display: none;\n}\n\n.page-id-99 #copyright-wrapper {\n	display: none;\n}\n\n.page-id-99 #contact-button {\n	display: none;\n}\n\ndiv#whiteText h1 {\n	color: white !important;\n}\n\ndiv#whiteText p {\n	color: white !important;\n}\n\n.episodeHead {\n	font-size: x-large;\n	font-weight: 900 !important;\n	border-bottom: 1px solid red;\n	padding-bottom: 5px;\n}\n\n.episodeHeadWhiteText {\n	font-size: xx-large;\n	color: white;\n	font-weight: 900 !important;\n	text-transform: uppercase;\n	border-bottom: 1px solid red;\n	padding-bottom: 5px;\n}\n\n/* Fix hover issue on overlays and ajax buttons */\na.load-more-posts:hover {\n	color: #FFFFFF !important;\n}\n\na.hb-buy-button {\n	color: #FFFFFF !important;\n}\n\na.hb-buy-button:hover {\n	color: #DD3333 !important;\n}\n\n/* Change widget title to U&lc, bold, add underline and negative space below */\nh4.widget-title {\n	font-size: 20pt !important;\n	text-transform: capitalize !important;\n	font-weight: bold !important;\n	margin-bottom: 5px !important;\n	border-bottom-style: solid;\n	border-width: 2px;\n	padding-bottom: 5px;\n}\n\n/* Change product widget title to U&lc and bold */\n.widget-item.woocommerce .product_list_widget a {\n	font-size: 11pt;\n	padding-top: 10px;\n	font-weight: 700 !important;\n	text-transform: capitalize !important;\n}\n\n/* Add space above news widget elements */\n.cat-post-item {\n	padding-top: 10px !important;\n	padding-bottom: 10px !important;\n}', 'safecss', 'Highend Child', 'inherit', 'open', 'open', '', '456-revision-v1', '', '', '2014-08-12 13:01:35', '2014-08-12 17:01:35', '', 456, 'http://localhost/genco/2014/08/456-revision-v1/', 0, 'revision', '', 0),
